import React, { useState, useEffect } from 'react';
import {
  Dialog,
  DialogTitle,
  DialogContent,
  DialogActions,
  Button,
  FormControl,
  InputLabel,
  Select,
  MenuItem,
  Typography,
  CircularProgress,
  Alert
} from '@mui/material';
import axios from 'axios';
import { API_URL, USER_ENDPOINTS } from '../../utils/apiConfig';
import { useTickets } from '../../contexts/TicketContext';

const AssignTicketDialog = ({ open, handleClose, ticketId, onSuccess }) => {
  const [technicians, setTechnicians] = useState([]);
  const [selectedTechnician, setSelectedTechnician] = useState('');
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);
  const { assignTicket } = useTickets();

  useEffect(() => {
    const fetchTechnicians = async () => {
      try {
        setLoading(true);
        console.log('Fetching technicians from:', USER_ENDPOINTS.GET_TECHNICIANS);
        const token = localStorage.getItem('token');
        console.log('Using token:', token?.substring(0, 10) + '...');

        const response = await axios.get(USER_ENDPOINTS.GET_TECHNICIANS, {
          headers: {
            Authorization: `Bearer ${token}`
          }
        });

        console.log('Technicians API response:', response.status);
        console.log('Technicians data:', response.data);

        if (Array.isArray(response.data) && response.data.length > 0) {
          setTechnicians(response.data);
        } else {
          console.error('No technicians found or invalid data format:', response.data);
          setError('No technicians available');
        }
      } catch (err) {
        console.error('Error fetching technicians:', err);
        console.error('Error response:', err.response?.data);
        setError('Failed to load technicians');
      } finally {
        setLoading(false);
      }
    };

    if (open) {
      fetchTechnicians();
      setSelectedTechnician('');
      setError(null);
    }
  }, [open]);

  const handleAssign = async () => {
    if (!selectedTechnician) {
      setError('Please select a technician');
      return;
    }

    try {
      setLoading(true);
      console.log('Assigning ticket', ticketId, 'to technician', selectedTechnician);

      const result = await assignTicket(ticketId, selectedTechnician);
      console.log('Assignment result:', result);

      if (onSuccess) {
        console.log('Calling onSuccess callback');
        onSuccess();
      }
      handleClose();
    } catch (err) {
      console.error('Error assigning ticket:', err);
      console.error('Error details:', err.response?.data);
      setError(err.message || 'Failed to assign ticket');
    } finally {
      setLoading(false);
    }
  };

  return (
    <Dialog open={open} onClose={handleClose} fullWidth maxWidth="sm">
      <DialogTitle>Assign Ticket</DialogTitle>
      <DialogContent>
        {error && <Alert severity="error" sx={{ mb: 2 }}>{error}</Alert>}

        <Typography variant="body2" sx={{ mb: 2 }}>
          Select a technician to assign this ticket to:
        </Typography>

        {loading && technicians.length === 0 ? (
          <div style={{ display: 'flex', justifyContent: 'center', padding: '20px' }}>
            <CircularProgress size={30} />
          </div>
        ) : (
          <FormControl fullWidth>
            <InputLabel id="technician-select-label">Technician</InputLabel>
            <Select
              labelId="technician-select-label"
              value={selectedTechnician}
              onChange={(e) => setSelectedTechnician(e.target.value)}
              label="Technician"
              disabled={loading}
            >
              {technicians.length === 0 ? (
                <MenuItem disabled value="">
                  No technicians available
                </MenuItem>
              ) : (
                technicians.map((tech) => (
                  <MenuItem key={tech._id} value={tech._id}>
                    {tech.firstName && tech.lastName 
                      ? `${tech.firstName} ${tech.lastName}` 
                      : tech.username || 'Technician'}
                  </MenuItem>
                ))
              )}
            </Select>
          </FormControl>
        )}
      </DialogContent>
      <DialogActions>
        <Button onClick={handleClose} disabled={loading}>Cancel</Button>
        <Button 
          onClick={handleAssign} 
          color="primary" 
          variant="contained" 
          disabled={loading || !selectedTechnician}
        >
          {loading ? <CircularProgress size={24} /> : 'Assign'}
        </Button>
      </DialogActions>
    </Dialog>
  );
};

export default AssignTicketDialog;
